--
-- Structure de la table `specialite`
--

CREATE TABLE `specialite` (
  `CodeCIS` varchar(8) NOT NULL,
  `Denomination_medicament` varchar(227) DEFAULT NULL,
  `Forme_pharmaceutique` varchar(89) DEFAULT NULL,
  `Voie_administration` varchar(92) DEFAULT NULL,
  `Type_procedure_AMM` varchar(36) DEFAULT NULL,
  `Date_AMM` varchar(10) DEFAULT NULL,
  `Titulaire(s)` varchar(65) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

